import FormContainer from "../components/FormContainer";
import Property1Default1 from "../components/Property1Default1";
import IPhoneStatusBarupper from "../components/IPhoneStatusBarupper";
import { FontFamily, FontSize, Color, Border, Padding } from "../GlobalStyles";

const HistoricoServios = () => {
  const [frameVisible, setFrameVisible] = useState(false);
  const [filtrarContainerVisible, setFiltrarContainerVisible] = useState(false);
  const navigation = useNavigation();

  const openFrame = useCallback(() => {
    setFrameVisible(true);
  }, []);

  const closeFrame = useCallback(() => {
    setFrameVisible(false);
  }, []);

  const openFiltrarContainer = useCallback(() => {
    setFiltrarContainerVisible(true);
  }, []);

  const closeFiltrarContainer = useCallback(() => {
    setFiltrarContainerVisible(false);
  }, []);

  return (
    <>
      <View style={styles.historicoServios}>
        <ServiceCard />
        <FormContainer
          imageDimensions={require("../assets/ellipse-201.png")}
          propTop={193}
          propLeft={11}
          onFramePressablePress={openFrame}
        />
