          style={[styles.filtrar, styles.navbarShadowBox]}
          onPress={openFiltrarContainer}
        >
          <View style={[styles.anterioresParent, styles.navbarFlexBox]}>
            <Text style={styles.anteriores}>Anteriores</Text>
            <Image
              style={styles.materialSymbolskeyboardArroIcon}
              contentFit="cover"
              source={require("../assets/materialsymbolskeyboardarrowup.png")}
            />
          </View>
        </Pressable>
        <Text style={[styles.histricoDeServios, styles.serviosTypo]}>
          Histórico de serviços
        </Text>
        <Property1Default1
          icon={require("../assets/icon4.png")}
          vector={require("../assets/vector8.png")}
          label="Serviços"
          icon1={require("../assets/icon1.png")}
          mdiclipboardTextHistory={require("../assets/mdiclipboardtexthistory2.png")}
